//import {getRequest ,postRequest  ,patchRequest} from '../service/axios.service'
import myaxios from '../service/axios.service'

export const createHero = (hero) => {
   return myaxios.post("heroes/create", hero);
}

export const updateHero = (hero) => {
   return myaxios.put("heroes/update?org-secret=" + store.state.orgSecret, hero);
}

const getHeroById = (idHero) => {
   return myaxios.get("heroes/getbyid/" + idHero + "?org-secret=" + store.state.orgSecret);
}
